    "# If you have long variable names, geom_boxplot() will work better if you flip it 90°. You can do that with coord_flip().\n",
    "ggplot(data = mpg) +\n",
    "  geom_boxplot(mapping = aes(x = reorder(class, hwy, FUN = median), y = hwy)) +\n",
    "  coord_flip()"
   ]
